import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getListItemContentUtilityClass(slot) {
  return generateUtilityClass('JoyListItemContent', slot);
}
const listItemContentClasses = generateUtilityClasses('JoyListItemContent', ['root']);
export default listItemContentClasses;
